import {Link} from "react-router-dom";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faCalendar, faCirclePlus,faMagnifyingGlass} from '@fortawesome/free-solid-svg-icons'
import Filter from "./filter";
import {useEffect, useState} from "react";

function HomePage() {


    const [datas,setDatas]=useState([])
    const [startCount,setCount]=useState(0)

    const deneme=(startCount)=>{
        datas?.content?.length.map(data=>{
            startCount++
            startCount=data.id
        })
    }

    const fetchData= async () =>{
        try{
            const response= await fetch('http://localhost:8000/data')
            const json= await response.json()
            setDatas(json)
            console.log(json)
        }catch (err) {
            console.log(err)
        }
    }

    useEffect(()=>{
        fetchData()

    },[])

    useEffect(()=>{
        deneme()
        console.log(startCount)
        console.log(deneme())
    },[startCount])


    return (
    <>

    <div className="w-full">

        <div className="flex items-center justify-center flex-col title-font font-medium text-gray-900 mb-4 md:mb-0 mt-5">

            <svg width="50" height="53" viewBox="0 0 60 63" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path fill-rule="evenodd" clip-rule="evenodd" d="M17.4554 18L29.8064 36.8759L42.1575 18L59.6129 18L29.8064 63L0 18L17.4554 18ZM17.4554 18L5.67742 0L53.9355 3.48837e-06L42.1575 18L17.4554 18Z" fill="#FF0D87"/>
            </svg>

            <h1 className="mt-12 text-3xl">
                ETKİNLİKLER
            </h1>

        </div>

        <section className="mt-5 md:mx-auto ml:mx-auto flex flex-wrap">

            <nav className="md:ml-auto md:mr-auto flex items-center justify-center text-sm mt-8">
                <Link to="/" className="block py-1 pl-2 pr-2 hover:text-pink-600">Tüm Etkinlikler</Link>
                <Link to="/Theater" className="block py-1 pl-2 pr-3 hover:text-cpink">Tiyatro</Link>
                <Link to="/Concert" className="block py-1 pl-2 pr-3 hover:text-cpink" >Konser</Link>
                <Link to="/StandUp" className="block py-1 pl-2 pr-3 hover:text-cpink">Stand Up</Link>
                <Link to="/Cinema"  className="block py-1 pl-2 pr-3 hover:text-cpink"  >Sinema</Link>
                <Link to="/Child"   className="block py-1 pl-2 pr-3 hover:text-cpink" >Çocuk</Link>

            </nav>

            <div className="flex -mt-4">

                <FontAwesomeIcon icon={faMagnifyingGlass}  className="mt-16 z-10 -mx-20 my-5"/>
                <input className="mt-14 w-36 h-10 mx-12 -my-12 border-cgray border-2  z-0" type="text"
                       placeholder="           Etkinlik ara"/>

            </div>
        </section>

        <section className="flex justify-between w-full h-10 bg-gray-100 border-1 mt-8">

            <div className="flex ml-12">
                <svg className="mt-2 -mr-8" width="10" height="20" viewBox="0 0 10 18" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <circle cx="2" cy="2" r="1.5" fill="black" stroke="black"/>
                    <circle cx="8" cy="9" r="1.5" fill="black" stroke="black"/>
                    <circle cx="2" cy="16" r="1.5" fill="black" stroke="black"/>
                </svg>

                {datas?.content?.map((contentItem)=>(
                    <Filter key={contentItem.id}
                            position={contentItem.location}
                            itemDate={contentItem.date}
                    />
                ))}

            </div>

            <p className="py-1 pl-2 pr-2 mt-1 mr-12">
                <FontAwesomeIcon icon={faCalendar} className="px-2" />
                Takvimde Gör
            </p>

        </section>



        {datas?.content?.length.map((item)=>(
        <body>
        <div className="container flex h-52 border-2 relative m-auto text-sm mt-12 w-2/3">
            <div className="flex border-0 bg-black w-1/5 z-0 ">
                <p className="flex text-center text-cpink ml-4 mt-14">{item[startCount].date}</p>
            </div>

            <div className="relative right-52 flex mt-2">
                <h2 className="relative left-24 text-center h-6 w-56 bg-corange text-white mt-6 z-10">{item[startCount].type}</h2>
                <img className=" w-auto h-44 relative -right-12 z-0 mt-1" src="https://klassmagazin.com//img/408cb1a0-a68c-4c7f-972b-dc037c7ad78c55.jpg"/>
            </div>

            <div className="flex mt-8">
                <div className="flex flex-col -ml-36 ">
                    <h2>{item[startCount].name}</h2>
                    <p className="text-cgray ml-4 mt-3 mb-3 ">{item[startCount].location}</p>
                    <p className="flex flex-wrap w-9/12 h-32">{item[startCount].text}
                    </p>
                </div>
                <div className="flex flex-col -ml-40 mr-4 mt-3">
                    <button className="w-44 h-14 border-2 bg-cpink text-cwhite ">
                        Bilet al
                    </button>

                    <div className=" px-9 py-4">
                        <FontAwesomeIcon icon={faCirclePlus} className= "w-5 h-5 mt-1" />
                        Takvime ekle</div>
                </div>
            </div>
        </div>
        </body>
        ))}

    </div>

    </>

    )
}
export default HomePage
